import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import styles from './cssPage/potfolio.module.css';  // Import CSS module

function App() {
  return (
    <BrowserRouter>
      <div className={"styles.container"}>  {/* Use styles.container for the CSS module class */}
        <h1 className={styles.title}>hello world</h1>  {/* Use styles.title */}
      </div>
    </BrowserRouter>
  );
}

export default App;
